package zakjo.studentsapp.model;public class Subjects {    public int c_id ;    public String c_name ;    public String stage_id ;    public Subjects(int c_id, String c_name, String stage_id) {        this.c_id = c_id;        this.c_name = c_name;        this.stage_id = stage_id;    }    public Subjects() {    }    public int getC_id() {        return c_id;    }    public void setC_id(int c_id) {        this.c_id = c_id;    }    public String getC_name() {        return c_name;    }    public void setC_name(String c_name) {        this.c_name = c_name;    }    public String getStage_id() {        return stage_id;    }    public void setStage_id(String stage_id) {        this.stage_id = stage_id;    }}